import React from 'react';
import { Container, Row, Col } from 'react-bootstrap';

const AboutJourney = () => {
  return (
    <Container fluid className="py-5 bg-light border-top border-black">
      <Container>
        <Row className="justify-content-center">
          <Col xs={12} md={10} lg={8} className="text-center">
            <h2 className="display-4 mb-4" style={{ 
              fontFamily: "'Helvetica Neue', sans-serif",
              fontWeight: 300,
              lineHeight: 1.2,
              fontSize:"3.5rem",
            }}>
              From the living room to<br />
              <span style={{ fontWeight: 600 }}>Shark Tank to now.</span>
            </h2>
            <div style={{
              width: '80px',
              height: '2px',
              backgroundColor: '#000',
              margin: '2rem auto'
            }}></div>
          </Col>
        </Row>
      </Container>
    </Container>
  );
};

export default AboutJourney;
